const utils = require('./utils');
// const map = require('./../maps');
// const player = require('./../player');
// const overlay = require('./../overlay');
// const enemies = require('./../enemy');


// <--------------- Attempting to open index.html --------------->
var http = require('http');
var fs = require('fs');

const PORT=5502; 

fs.readFile('./index.html', function (err, html) {

    if (err) throw err;    

    http.createServer(function(request, response) {  
        response.writeHeader(200, {"Content-Type": "text/html"});  
        response.write(html);  
        response.end();  
    }).listen(PORT);
});
// <--------------- Attempting to open index.html --------------->

var assert = require('assert');


describe('Array', function () {
  describe('#indexOf()', function () {
    it('should have a map.js file', () => {
      const map = require('./../map.js');
      assert(map);
    })

    // Breaks on p5 not defined
    // it('should have a player.js file', () => {
    //   const player = require('./../player.js');

    //   assert(player);
    // })

    it('should have an overlay.js file', () => {
      const overlay = require('./../overlay.js');
      assert(overlay);
    })

    it('should have an enemies.js file', () => {
      const enemies = require('./../enemies.js');
      assert(enemies);
    })

    // pending test below
    it('Test requirement pending');
  });
});

http.createServer.end;

