import { makeSpell } from "./attacks.js";
import { cameraOffset } from "./sketch.js";


export function makePlayer(p, Map) { //Receive map object
    return {
        sprite: new p.Sprite(25, 25, 20, 32),
        currentAnimation: null,
        animations: {},
        speed: 3,
        isDead: false,
        health: 1,
        spells: [],
